class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        t_counts = {}

        for char in t:
                t_counts[char] = t.count(char)

        for char in s:
            t_counts[char] -= 1
            if t_counts[char] == 0:
                del t_counts[char]

        return list(t_counts.keys())[0]





print(Solution().findTheDifference(s =
"",
t = ""))
print(Solution().findTheDifference(s = "abcd", t = "abcde"))
print(Solution().findTheDifference(s = "", t = "y"))
print(Solution().findTheDifference(s = "a", t = "aa"))

